to explore the area and enjoy all that the Savannah river and canal has in store.[/vc_willow_service_block][/vc_column][vc_column width=\"1/3\"][vc_willow_service_block heading=\"Sales\" icon=\"linecons li_shop\"]We provide the latest in the Jamis line of bicycles. From the basic cruiser to the top of the line racer, we can keep you peddling in style.[/vc_willow_service_block][/vc_column][/vc_row][vc_row][vc_column][vc_separator][/vc_column][/vc_row][vc_row full_height=\"yes\" parallax=\"true\" parallax_image=\"15\" bg_image_repeat=\"cover\" css=\".vc_custom_1451323073011{margin-top: 30px !important;background-position: center;background-repeat: no-repeat !important;background-size: cover !important;}\" el_id=\"rentals-row\"][vc_column width=\"1/2\"][vc_single_image image=\"124\" img_size=\"full\" css_animation=\"left-to-right\"][/vc_column][vc_column width=\"1/2\"][vc_column_text el_class=\"service-text\"]We provide hourly and daily rentals for individuals and groups, adults and children.\r\n\r\nExperience the beauty of the Savannah river and canal and local area that only two wheels can take you.\r\n\r\nFollow the link to find out more: <a href=\"http://bicyclepeddleraugusta.com/rentals/\">See More</a>[/vc_column_text][/vc_column][/vc_row][vc_row css=\".vc_custom_1451323079594{margin-top: 30px !important;}\"][vc_column width=\"1/2\"][vc_column_text el_class=\"service-text\"]We specialize in the Jamis line of bikes and accessories.\r\n\r\nWe work directly with you to find the perfect bike that will fit how you ride, your budget and you, personally.\r\n\r\nChoose from the wide in-house selection or we can order your dream bike for you.\r\n\r\n<a href=\"http://bicyclepeddleraugusta.com/sales/\">Find Out More</a>[/vc_column_text][/vc_column][vc_column width=\"1/2\"][vc_single_image image=\"16\" img_size=\"full\" css_animation=\"right-to-left\"][/vc_column][/vc_row][vc_row css=\".vc_custom_1451323087267{margin-top: 30px !important;}\"][vc_column width=\"1/2\"][vc_singl